import React from 'react';

const TitleStyle = {
  paddingBottom: '20px'
};

const Title = ({onClick}) => {
  return(
    <div className="ui two column doubling stackable grid container" style={TitleStyle}>
      <div className="column">
        <h3>TODO</h3>
      </div>
      <div className="column">
        <div className="ui action input right floated">
            <input type="text" id="inputinput" placeholder="Get groceries.." ref={(input => this.textInput = input)}/>
            <button className="ui button" onClick={onClick}>Add TODO</button>
        </div>
      </div>
    </div>
  );
};

export default Title;
